window.bookSummaryJSON = "<p>What happens when a dragon discovers the existence of El Dorado? An epic and hilarious world tour of course!</p> <p>Vainqueur Knightsbane and his minion Victor are back for their most dangerous adventure yet: circling the world of Outremonde in their quest for levels, riches, and glory! Together, they will save lost cities of gold from lead-loving undead, conquer countries wholly unprepared for them, and spread the Dragon Way of Life across the globe!&nbsp;</p> <p>But the fairy lords of the Fomors have gained the ability to level-up, and their threat looms ever closer....</p>"; 
